int config_defaults(config_main_t * cfg) {
    cfg->Server.ident = 1;
    cfg->Server.zmq_io_threads = 1;
    cfg->Server.disk_io_threads = 1;
    config_defaults_zmqsocket(&cfg->Server.control.socket);
    cfg->Server.max_requests = 4096;
    cfg->Server.max_websockets = 4096;
    cfg->Server.network_timeout = 120.0;
    cfg->Server.mime_types.no_warnings = FALSE;
    cfg->Server.mime_types.file = "/etc/mime.types";
    cfg->Server.mime_types.file_len = 15;
    cfg->Server.mime_types.no_extension = "text/plain";
    cfg->Server.mime_types.no_extension_len = 10;
    cfg->Server.mime_types.default_type = "application/octed-stream";
    cfg->Server.mime_types.default_type_len = 24;
    cfg->Server.error_log.level = 6;
    cfg->Server.error_log.warning_timeout = 300;
    cfg->Server.error_log.filename = "/var/log/zerogw/error.log";
    cfg->Server.error_log.filename_len = 25;
    cfg->Server.pools.backend_messages = 4096;
    cfg->Server.pools.frontend_messages = 4096;
    cfg->Server.pools.subscriptions = 128;
    cfg->Estp.host_name = "localhost";
    cfg->Estp.host_name_len = 9;
    cfg->Estp.application_name = "zerogw";
    cfg->Estp.application_name_len = 6;
    config_defaults_zmqsocket(&cfg->Estp.socket);
    cfg->Estp.interval = 10;
    config_defaults_Route(&cfg->Routing);
    return 0;
}
