int config_print(FILE * out, config_main_t * cfg, coyaml_print_enum mode) {
    return coyaml_print(out, &config_group_vars[32], cfg, mode);
}
config_main_t * config_init(config_main_t * ptr) {
    config_main_t * res = ptr;
    if(!res) {
        res = (config_main_t *)malloc(sizeof(config_main_t));
    }
    if(!res) {
        return NULL;
    }
    bzero(res, sizeof(config_main_t));
    if(!ptr) {
        res->head.free_object = TRUE;
    }
    obstack_init(&res->head.pieces);
    config_defaults(res);
    return res;
}
coyaml_context_t * config_context(coyaml_context_t * inp, config_main_t * tinp) {
    coyaml_context_t * ctx = coyaml_context_init(inp);
    if(!ctx) {
        return NULL;
    }
    ctx->target = (coyaml_head_t *)config_init(tinp);
    if(!ctx->target) {
        coyaml_context_free(ctx);
        return NULL;
    }
    ctx->program_name = "zerogw";
    ctx->root_filename = "/etc/zerogw.yaml";
    ctx->cmdline = &config_cmdline;
    ctx->env_vars = config_env_vars;
    ctx->root_group = &config_group_vars[32];
    return ctx;
}
void config_free(config_main_t * ptr) {
    obstack_free(&ptr->head.pieces, NULL);
    if(ptr->head.free_object) {
        free(ptr);
    }
}
bool config_readfile(coyaml_context_t * ctx) {
    return coyaml_readfile(ctx);
}
config_main_t * config_load(config_main_t * ptr, int argc, char** argv) {
    coyaml_context_t ctx;
    if(config_context(&ctx, ptr) < 0) {
        perror(argv[0]);
        exit(1);
    }
    coyaml_cli_prepare_or_exit(&ctx, argc, argv);
    coyaml_readfile_or_exit(&ctx);
    coyaml_env_parse_or_exit(&ctx);
    coyaml_cli_parse_or_exit(&ctx, argc, argv);
    coyaml_context_free(&ctx);
    return (config_main_t *)ctx.target;
}
